import React from 'react';
import Logo from '../../assets/img/Gatonetiflix.png'
import './Menu.css'
function Menu(){
    return(
        <header>
            <img class="Logo" src ={Logo} alt= "gatonetflix logo"/>
        </header>
    );
}

 export default Menu;
